create extension if not exists "uuid-ossp";


create table Specialization (
    id uuid primary key default uuid_generate_v4(),
    name varchar(40) unique not null,
    status boolean default true not null
);


create table Role (
    id uuid primary key default uuid_generate_v4(),
    name varchar(30) unique not null,
    status boolean default true not null
);


create table Users (
    id uuid primary key default uuid_generate_v4(),
    email varchar(50) unique not null,
    username varchar(30) unique not null,
    password varchar(50) not null,
    createdAt timestamp not null default now(),
    status boolean default true not null
);

create table AdminUser (
    userId uuid primary key references Users(id)
);

create table AdminUserRoles (
    roleId uuid not null references Role(id),
    adminUserId uuid not null references AdminUser(userId),
    primary key (roleId, adminUserId)
);


create table State (
    uf char(2) primary key,
    name varchar(40) not null
);


create table City (
    id uuid primary key default uuid_generate_v4(),
    name varchar(100) not null,
    stateUf char(2) not null references State(uf)
);




create table Laboratory (
    id uuid primary key default uuid_generate_v4(),
    name text not null,
    cnpj char(14),
    status boolean default true not null
);


create table Medicine (
    id uuid primary key default uuid_generate_v4(),
    name text not null,
    activePrinciple text not null,
    register varchar(20) not null,
    laboratoryId uuid not null references Laboratory(id),
    situation boolean default true not null,
    expiration timestamp
);


create table Symptom (
    id uuid primary key default uuid_generate_v4(),
    description varchar(100) unique not null,
    status boolean default true not null
);

